import React, {useEffect, useState} from "react";
import client from "./api/client";

function App(){
  const [msg, setMsg] = useState('');

  useEffect(()=>{
    client.get('hello/').then(res=> setMsg(res.data.message))
  },[])

  return <h1>{msg ? msg : "Loading" }</h1>
}

export default App;
